import React from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

export default class AllMatches extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            matches: []
        }
    }

    componentDidMount() {
        axios.get("localhost:5000/match")
            .then(res => {
                this.setState({
                    matches: res
                });
            })
            .catch(err => console.log(err));
    }

    render() {
        return (
            <React.Fragment>
                {this.state.matches}
            </React.Fragment>
        )
    }
}
